from collections import OrderedDict

def mru_cache(maxsize=128, typed=False):
    """
    Decorator to wrap a function with a memoizing callable that saves
    up to `maxsize` results based on a Most Recently Used (MRU)
    algorithm.
    """
    class MRUCache:
        def __init__(self, maxsize, typed):
            self.maxsize = maxsize
            self.typed = typed
            self.cache = OrderedDict()

        def __call__(self, func):
            @functools.wraps(func)
            def wrapper(*args, **kwargs):
                key = self._make_key(args, kwargs)
                if key in self.cache:
                    self.cache.move_to_end(key, last=False)
                    return self.cache[key]
                else:
                    result = func(*args, **kwargs)
                    self.cache[key] = result
                    self.cache.move_to_end(key, last=False)
                    if self.maxsize is not None and len(self.cache) > self.maxsize:
                        self.cache.popitem(last=True)
                    return result
            return wrapper

        def _make_key(self, args, kwargs):
            key = []
            for arg in args:
                key.append(arg)
                if self.typed:
                    key.append(type(arg))
            for k, v in sorted(kwargs.items()):
                key.append(k)
                if self.typed:
                    key.append(type(k))
                key.append(v)
                if self.typed:
                    key.append(type(v))
            return tuple(key)

    return MRUCache(maxsize, typed)

import functools

def lru_cache(maxsize=128, typed=False):
    """
    Decorator to wrap a function with a memoizing callable that saves
    up to `maxsize` results based on a Least Recently Used (LRU)
    algorithm.
    """
    def decorator(func):
        @functools.lru_cache(maxsize=maxsize, typed=typed)
        def wrapper(*args, **kwargs):
            return func(*args, **kwargs)
        return wrapper
    return decorator

def lfu_cache(maxsize=128, typed=False):
    """
    Decorator to wrap a function with a memoizing callable that saves
    up to `maxsize` results based on a Least Frequently Used (LFU)
    algorithm.
    """
    class LFUCache:
        def __init__(self, maxsize, typed):
            self.maxsize = maxsize
            self.typed = typed
            self.cache = {}
            self.freq = {}
            self.order = []

        def __call__(self, func):
            def wrapper(*args, **kwargs):
                if self.typed:
                    key = (args, tuple(sorted(kwargs.items())))
                else:
                    normalized_args = tuple(str(arg) for arg in args)
                    normalized_kwargs = tuple((k, str(v)) for k, v in kwargs.items())
                    key = (normalized_args, normalized_kwargs)
                if key in self.cache:
                    self.freq[key] += 1
                    return self.cache[key]
                if len(self.cache) >= self.maxsize:
                    min_freq = min(self.freq.values())
                    candidates = [k for k in self.cache if self.freq[k] == min_freq]
                    for k in self.order:
                        if k in candidates:
                            del self.cache[k]
                            del self.freq[k]
                            self.order.remove(k)
                            break
                self.cache[key] = func(*args, **kwargs)
                self.freq[key] = 1
                self.order.append(key)
                return self.cache[key]
            return wrapper
    return LFUCache(maxsize, typed)

def popitem(self):
    """
    Remove the value corresponding to the first inserted key and returns the key and value in tuple format.
    """
    if not self:
        raise KeyError("popitem() from empty dictionary")
    key = next(iter(self))
    value = self[key]
    del self[key]
    return (key, value)

