def get_deprecated_args(self):
    """
    Returning dict with options which deprecate others. options from self.spec_helper.iterate_option_specs()
    """
    deprecated_args = {}
    for option in self.spec_helper.iterate_option_specs():
        if option.deprecated:
            deprecated_args[option.name] = option.replacement
    return deprecated_args

class ArgumentValidator:
    DEPRECATED_ARGS = {
        'old_arg': 'Use new_arg instead.',
        'deprecated_option': 'This option is no longer supported.'
    }

    def validate_arg_deprecation(self, cli_args, answer_file_args):
        """
        Validates and prints the deprecated arguments.

        :param cli_args: the dict of arguments from cli
        :param answer_file_args:  the dict of arguments from files
        """
        for arg in cli_args:
            if arg in self.DEPRECATED_ARGS:
                print(f"Warning: CLI argument '{arg}' is deprecated. {self.DEPRECATED_ARGS[arg]}")
        for arg in answer_file_args:
            if arg in self.DEPRECATED_ARGS:
                print(f"Warning: Answer file argument '{arg}' is deprecated. {self.DEPRECATED_ARGS[arg]}")

def get_parser_option_specs(self, command_name):
    """
    Gets all the options for the specified command

    :param command_name: the command name (main, virsh, ospd, etc...)
    :return: the list of all command options
    """
    command_options = {
        'main': [
            {'name': '--verbose', 'type': bool, 'help': 'Enable verbose mode'},
            {'name': '--output', 'type': str, 'help': 'Output format'},
        ],
        'virsh': [
            {'name': '--connect', 'type': str, 'help': 'Connect to a specific hypervisor'},
            {'name': '--help', 'type': None, 'help': 'Show help message'},
        ],
        'ospd': [
            {'name': '--config', 'type': str, 'help': 'Path to configuration file'},
            {'name': '--debug', 'type': bool, 'help': 'Enable debug mode'},
        ],
    }
    return command_options.get(command_name, [])

def get_option_spec(self, command_name, argument_name):
    """
    Gets the specification for the specified option name. Get options of the given command_name with self.get_parser_option_specs()
    """
    options = self.get_parser_option_specs(command_name)
    for option in options:
        if option.name == argument_name:
            return option
    return None

def validate_requires_args(self, args):
    """
    Check if all the required arguments have been provided.
    """
    required_args = self.required_args
    for arg in required_args:
        if arg not in args:
            return False
    return True

def validate_length_args(self, args):
    """
    Check if value of the given args is not longer than length specified. \n:param args: The received arguments.
    """
    for arg in args:
        if len(arg) > self.max_length:
            raise ValueError(f"Argument {arg} exceeds maximum length of {self.max_length}.")
    return True

def validate_choices_args(self, args):
    """
    Check if value of the given args is one of the available choices. \n:param args: The received arguments.
    """
    for arg in args:
        if arg not in self.choices:
            raise ValueError(f"Invalid choice: {arg}. Valid choices are {self.choices}")
    return True

def validate_min_max_args(self, args):
    """
    Check if value of the given args is between minimum and maximum values
    """
    for arg in args:
        if arg < self.min or arg > self.max:
            return False
    return True

def create_complex_argumet_type(self, subcommand, type_name, option_name, spec_option):
    """
    Returns the corresponding function in COMPLEX_TYPES based on type_name and returns the result obtained by complex_action after option_name,(self.vars, self.defaults, self.plugin_path), subcommand, spec_option) is input.
    """
    func = COMPLEX_TYPES.get(type_name)
    if func is None:
        raise KeyError(f"Type {type_name} not found in COMPLEX_TYPES")
    return func(option_name, self.vars, self.defaults, self.plugin_path, subcommand, spec_option)

def _convert_non_cli_args(self, parser_name, values_dict):
    """
    Casts arguments to correct types by modifying values_dict param.

    By default all the values are strings.

    :param parser_name: The command name, e.g. main, virsh, ospd, etc
    :param values_dict: The dict of with arguments
    """
    if parser_name == 'virsh':
        if 'port' in values_dict:
            values_dict['port'] = int(values_dict['port'])
        if 'timeout' in values_dict:
            values_dict['timeout'] = int(values_dict['timeout'])
        if 'debug' in values_dict:
            values_dict['debug'] = bool(values_dict['debug'])
    elif parser_name == 'ospd':
        if 'count' in values_dict:
            values_dict['count'] = int(values_dict['count'])
        if 'verbose' in values_dict:
            values_dict['verbose'] = bool(values_dict['verbose'])

import yaml
import os

def get_plugin_spec_flatten_dict(plugin_dir):
    """
    Use YAML to read various information in plugin_dir and return the information in dictionary form.
    """
    spec_path = os.path.join(plugin_dir, 'spec.yaml')
    with open(spec_path, 'r') as file:
        spec_data = yaml.safe_load(file)
    def flatten(d, parent_key='', sep='.'):
        items = []
        for k, v in d.items():
            new_key = f"{parent_key}{sep}{k}" if parent_key else k
            if isinstance(v, dict):
                items.extend(flatten(v, new_key, sep=sep).items())
            else:
                items.append((new_key, v))
        return dict(items)
    return flatten(spec_data)

